import React from 'react';
import { Link } from 'react-router-dom';
import '../../App.css'

function DrugStoresAvailable() {
  return (
      <div className="App">

        {/* logo container */}
        <div className="logo_container">
          {/* logo PharmaXcess */}
          <img src={require("./../../assets/logo.png")} alt="Logo PharmaXcess" className="logo" />
        </div>

        {/* starting page */}
        <div className="starting_page">
          {/* Rectangle 'médicaments sous ordonnance' */}

          <Link to="/documents-checking" style={{ textDecoration: 'none' }}>
            <div className="rectangle" style={{top: '30%', left: '50%', cursor: 'pointer'}}>
              <p style={{ fontSize: '3em', textAlign: 'center' }}>
                Médicaments sous ordonnance
              </p>
            </div>
          </Link>

          {/* Rectangle 'médicaments sans ordonnance' */}

          <Link to="/non-prescription-drugs" style={{ textDecoration: 'none' }}>
          <div className="rectangle" style={{top: '35%', left: '50%'}}>
            <p style={{ fontSize: '3em', textAlign: 'center' }}>
              Médicaments sans ordonnance
            </p>
          </div>
          </Link>

        </div>
      </div>
  );
}

export default DrugStoresAvailable;
